
'use strict'
//http://localhost:8081/json?ob=usuario&op=login&user=ddd&pass=pass
moduleFactura.controller('facturaCarritoController', ['$scope', '$http', '$location', 'toolService', '$routeParams', 'sessionService',
    function ($scope, $http, $location, toolService, $routeParams, sessionService) {
        
// HEADER //

        $scope.loggeduser = sessionService.getUserName();
        $scope.loggeduserid = sessionService.getId();
        $scope.logged = sessionService.isSessionActive();
        $scope.tipousuarioID = sessionService.getTypeUserID();
        $scope.isActive = toolService.isActive;
        $scope.limpiar = sessionService.isSessionActive();


        $scope.productos = function () {
            if ($scope.logged === true) {
                $location.url(`carrito/plist_burger`);
            } else {
                $location.url(`usuario/login`);
            }
        };

        $scope.locales = function () {
            if ($scope.logged === true) {
                $location.url(`carrito/locales`);
            } else {
                $location.url(`usuario/login`);
            }
        };

        $scope.empresa = function () {
            if ($scope.logged === true) {
                $location.url(`carrito/empresa`);
            } else {
                $location.url(`usuario/login`);
            }
        };

        $scope.contacto = function () {
            if ($scope.logged === true) {
                $location.url(`carrito/contacto`);
            } else {
                $location.url(`usuario/login`);
            }
        };

        // HEADER//
        
        if (!$routeParams.id) {
            $scope.id = 1;
        } else {
            $scope.id = $routeParams.id;
        }

        $scope.miFormato = function (valor) {
            return isNaN(valor) ? valor : parseFloat(valor).toFixed(2);
        }
        
  

        $scope.isActive = toolService.isActive;

        $http({
            method: 'GET',
            url: 'json?ob=linea&op=getpagex&rpp=10&page=1&idajena=' + $scope.id
        }).then(function (response) {
            $scope.status = response.status;
            $scope.ajaxData = response.data.message;

            var cant = 0;
            var precio = 0;
            var iva = 0;
            var acum = 0;
            $scope.total = null;

            if (response.data.message.length !== null) {
                for (var i = 0; i < response.data.message.length; i++) {
                    cant = response.data.message[i].cantidad;
                    precio = response.data.message[i].obj_Producto.precio;
                    iva = response.data.message[i].obj_Factura.iva;
                    acum = acum + ((((iva / 100) * precio) + precio) * cant);
                    $scope.total = acum;
                }
            }




        }, function (response) {
            $scope.status = response.status;
            $scope.ajaxData = response.data.message || 'Request failed';
        });


        $scope.volver = function () {
            $location.url(`home`);
        }

        $scope.pdf = function () {

            //en el futuro habrÃ¡ que hacer una consulta a zona para saber el municipio del restaurante


            var usuario;
            var fecha;
            var lineasTotales;
            var iva;
            var telefono;
            var direccion;
            var nombre_rest;
            var poblacion_rest;
            var direccion_rest;
            var length = $scope.ajaxData.length;
            console.log(length);
            var doc = new jsPDF();
            for (var i = 0; i < length; i++) {
                console.log($scope.ajaxData[i]);
//              
                usuario = $scope.ajaxData[i].obj_Factura.obj_Usuario.nombre + ' ' + $scope.ajaxData[i].obj_Factura.obj_Usuario.ape1 + ' ' + $scope.ajaxData[i].obj_Factura.obj_Usuario.ape2;
                fecha = $scope.ajaxData[i].obj_Factura.fecha;
                lineasTotales = $scope.ajaxData[i].obj_Factura.link_linea;
                iva = $scope.ajaxData[i].obj_Factura.iva;
                telefono = $scope.ajaxData[i].obj_Factura.obj_Usuario.telefono;
                direccion = $scope.ajaxData[i].obj_Factura.obj_Usuario.direccion;
                nombre_rest = $scope.ajaxData[i].obj_Factura.obj_Restaurante.nombre;
                poblacion_rest = $scope.ajaxData[i].obj_Factura.obj_Restaurante.poblacion;
                direccion_rest = $scope.ajaxData[i].obj_Factura.obj_Restaurante.direccion;

            }
            ;


            $http({
                method: 'GET',
                url: 'json?ob=linea&op=getpagex&rpp=10000&page=1&idajena=' + $scope.id


            }).then(function (response) {
                $scope.status = response.status;
                $scope.ajaxLineasFactura = response.data.message;
                console.log($scope.ajaxLineasFactura);
                var imgData = 'data:image/png;base64,';

                //CABECERA
                doc.setDrawColor(255, 0, 0);
                doc.rect(8, 10, 195, 70);
                doc.rect(8, 10, 85, 70);
                doc.addImage(imgData, 'JPEG', 160, 12, 42, 40);
                doc.setFontSize(13);
                doc.setFontType('bold');
                doc.text(100, 20, 'Local: ' + nombre_rest);
                doc.setFontType('normal');
                doc.text(100, 40, 'Tel. 967 08 00 47');
                doc.text(100, 72, 'Email: ' + nombre_rest + '@gmail.com');
                doc.text(100, 30, 'CIF. B8541236');

                doc.text(100, 62, 'Direccion: ' + direccion_rest);
                doc.text(100, 50, 'Poblacion: ' + poblacion_rest);

                doc.setFontSize(30);
                doc.setFontType('bold');
                doc.text(10, 23, 'Factura N ' + $scope.id);
                doc.setFontSize(14);
                doc.setFontType('normal');
                doc.text(10, 40, 'Cliente: ' + usuario);
                doc.text(10, 50, 'Telefono: ' + telefono);
                doc.text(10, 60, 'Direccion: ' + direccion);
                doc.text(10, 70, 'Fecha: ' + fecha);


                doc.rect(8, 80, 195, 210);
                doc.setFontSize(15);
                doc.text(12, 90, 'Codigo');
                doc.text(50, 90, 'Nombre');
                doc.text(125, 90, 'Cantidad');
                doc.text(170, 90, 'Precio');
                doc.setFillColor(249, 177, 87);
                doc.rect(9, 93, 193, 3, 'F');
                doc.setFontSize(15);

                //LINEAS DE LA FACTURA
                var linea = 107;
                var precio = 0;
                var cantidad = 0;
                for (var x = 0; x <= lineasTotales - 1; x++) {
                    if (x % 14 === 0 && x !== 0) {
                        doc.addPage('a4', 1);
                        //CABECERA
                        doc.rect(8, 10, 195, 70);
                        doc.rect(8, 10, 85, 70);
                        doc.addImage(imgData, 'JPEG', 155, 12, 42, 40);
                        doc.setFontSize(13);
                        doc.text(100, 20, 'Local: ' + nombre_rest);
                        doc.setFontType('normal');
                        doc.text(100, 40, 'Tel. 967 08 00 47');
                        doc.text(100, 72, 'Email: ' + nombre_rest + '@gmail.com');
                        doc.text(100, 30, 'CIF. B8541236');

                        doc.text(100, 62, 'Direccion: ' + direccion_rest);
                        doc.text(100, 50, 'Poblacion: ' + poblacion_rest);


                        doc.setFontSize(30);
                        doc.setFontType('bold');
                        doc.text(15, 23, 'Factura N ' + $scope.id);
                        doc.setFontSize(16);
                        doc.setFontType('normal');
                        doc.text(10, 40, 'Cliente: ' + usuario);
                        doc.text(10, 50, 'Telefono: ' + telefono);
                        doc.text(10, 60, 'Direccion: ' + direccion);
                        doc.text(10, 70, 'Fecha: ' + fecha);

                        doc.rect(8, 80, 195, 210);
                        doc.setFontSize(15);
                        doc.text(12, 90, 'Codigo');
                        doc.text(50, 90, 'Nombre');
                        doc.text(125, 90, 'Cantidad');
                        doc.text(170, 90, 'Precio');
                        doc.setFillColor(249, 177, 87);
                        doc.rect(9, 93, 193, 3, 'F');
                        doc.setFontSize(15);
                        linea = 107;
                    }
                    doc.text(12, linea, $scope.ajaxLineasFactura[x].obj_Producto.codigo);
                    doc.text(50, linea, $scope.ajaxLineasFactura[x].obj_Producto.nombre);
                    doc.text(125, linea, ($scope.ajaxLineasFactura[x].cantidad).toString());
                    doc.text(170, linea, (parseFloat(($scope.ajaxLineasFactura[x].obj_Producto.precio)).toFixed(2).toString()));
                    linea = linea + 13;
                    precio = (precio + $scope.ajaxLineasFactura[x].obj_Producto.precio);
                    cantidad = cantidad + $scope.ajaxLineasFactura[x].cantidad;
                }

                //FOOTER DE FACTURA
                doc.setFillColor(249, 177, 87);
                doc.rect(9, 260, 193, 5, 'F');
                doc.text(12, 273, 'Cantidad Total');
                doc.text(70, 273, 'Precio');
                doc.text(115, 273, 'IVA');
                doc.text(150, 273, 'Precio Total(euros)');

                doc.text(23, 285, cantidad.toString());
                doc.text(70, 285, (precio.toFixed(2).toString()));
                doc.text(115, 285, (precio * (iva / 100)).toFixed(2).toString());
                doc.text(158, 285, (precio * (iva / 100 + 1)).toFixed(2).toString());

                doc.output('save', 'Factura-' + $scope.id + '.pdf'); //Try to save PDF as a file (not works on ie before 10, and some mobile devices)
//                doc.output('datauristring');        //returns the data uri string
//                doc.output('datauri');              //opens the data uri in current window
//                doc.output('dataurlnewwindow');     //opens the data uri in new window
            }, function (response) {
                $scope.status = response.status;
                $scope.ajaxLineasFactura = response.data.message || 'Request failed';
            });





        };

        $scope.isActive = toolService.isActive;



    }
]);